import { Config } from "../config/config";


export const Endpoints = {

  createList: `${Config.BASE_API_URL}/createList`,
  getAllLists: `${Config.BASE_API_URL}/lists/getList`,
  updateList: (id) => `${Config.BASE_API_URL}/lists/getList/${id}`,
  deleteList: (id) => `${Config.BASE_API_URL}/lists/getList/${id}`,
};
